[{"location":"api/#API-reference","page":"API reference","title":"API reference","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"CollapsedDocStrings = true\nCurrentModule = TrafficAssignment","category":"page"},{"location":"api/#Public","page":"API reference","title":"Public","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"Modules = [TrafficAssignment]\nPrivate = false","category":"page"},{"location":"api/#TrafficAssignment.TA_Data","page":"API reference","title":"TrafficAssignment.TA_Data","text":"mutable struct TA_Data\n\nFields\n\nnetwork_name::String\nnumber_of_zones::Int64\nnumber_of_nodes::Int64\nfirst_thru_node::Int64\nnumber_of_links::Int64\ninit_node::Vector{Int64}\nterm_node::Vector{Int64}\ncapacity::Vector{Float64}\nlink_length::Vector{Float64}\nfree_flow_time::Vector{Float64}\nb::Vector{Float64}\npower::Vector{Float64}\nspeed_limit::Vector{Float64}\ntoll::Vector{Float64}\nlink_type::Vector{Int64}\ntotal_od_flow::Float64\ntravel_demand::Matrix{Float64}\nod_pairs::Vector{Tuple{Int64, Int64}}\ntoll_factor::Float64\ndistance_factor::Float64\nbest_objective::Float64\n\n\n\n\n\n","category":"type"},{"location":"api/#TrafficAssignment.load_ta_network-Tuple{Any}","page":"API reference","title":"TrafficAssignment.load_ta_network","text":"load_ta_network(\n    network_name;\n    best_objective,\n    toll_factor,\n    distance_factor\n)\n\n\n\n\n\n\n","category":"method"},{"location":"api/#TrafficAssignment.ta_frank_wolfe-Tuple{TA_Data}","page":"API reference","title":"TrafficAssignment.ta_frank_wolfe","text":"ta_frank_wolfe(td; method, max_iter_no, step, log, tol)\n\n\nThis function implements methods to find traffic equilibrium flows: currently, Frank-Wolfe (FW) method, Conjugate FW (CFW) method, and Bi-conjugate FW (BFW) method.\n\nSettings\n\nmethod=:fw / :cfw / :bfw (default=:bfw)\nstep=:exact / :newton: exact line search using golden section / a simple Newton-type step (default=:exact)\nlog=:on / :off: displays information from each iteration or not (default=:off)\nmax_iter_no::Integer: maximum number of iterations (default=2000)\ntol::Real: tolerance for the Average Excess Cost (AEC) (default=1e-3)\n\nReferences\n\nMitradjieva, M., & Lindberg, P. O. (2013). The Stiff Is Moving-Conjugate Direction Frank-Wolfe Methods with Applications to Traffic Assignment. Transportation Science, 47(2), 280-293.\n\n\n\n\n\n","category":"method"},{"location":"api/#Private","page":"API reference","title":"Private","text":"","category":"section"},{"location":"api/","page":"API reference","title":"API reference","text":"Modules = [TrafficAssignment]\nPublic = false","category":"page"},{"location":"#TrafficAssignment.jl","page":"Home","title":"TrafficAssignment.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"(Image: Build Status) (Image: Coverage) (Image: Dev Documentation)","category":"page"},{"location":"","page":"Home","title":"Home","text":"This is a Julia package for studying traffic assignment on road networks.","category":"page"},{"location":"#Getting-started","page":"Home","title":"Getting started","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"To install the latest development version, run this in your Julia Pkg REPL:","category":"page"},{"location":"","page":"Home","title":"Home","text":"pkg> add https://github.com/gdalle/TrafficAssignment.jl","category":"page"},{"location":"","page":"Home","title":"Home","text":"You can easily load networks from the TransportationNetworks repository:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using TrafficAssignment\nta_data = load_ta_network(\"SiouxFalls\")\nta_data.number_of_zones\n\n# output\n\n24","category":"page"},{"location":"","page":"Home","title":"Home","text":"And then you can solve the equilibrium problem and compute the total system travel time:","category":"page"},{"location":"","page":"Home","title":"Home","text":"using LinearAlgebra\nlink_flow, link_travel_time, objective = ta_frank_wolfe(ta_data, log=\"off\", tol=1e-2)\nsystem_travel_time = round(dot(link_travel_time, link_flow); sigdigits=3)\n\n# output\n\n7.47e6","category":"page"},{"location":"#Credits","page":"Home","title":"Credits","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package was originally written and maintained by Changhyun Kwon.","category":"page"}]
